const HomeContainer = styled.div`
  background-color: #f5f5f5;
  min-height: 100vh;
`;

const Title = styled.h1`
  color: #002B5C;
  text-align: center;
  font-family: 'Inter', sans-serif;
  margin-top: 2rem;
`;

const Home = () => {
  return (
    <HomeContainer>
      <Navbar />
      <Title>CENTRO BUS PREDICTOR</Title>
      <FilterBar />
      {/* Placeholder NextBusCard showing no selection */}
      <NextBusCard route="" direction="" stop="" nextArrival="" />
    </HomeContainer>
  );
};

export default Home;
